import collections
def CountFrequency(Nuc_Seq):
    """Counts the frequency of each nucleotide in a given nucleotide sequence."""
    return dict(collections.Counter(Nuc_Seq))

string = ""
result = CountFrequency(string)
print(" ".join(str(val) for key, val in result.items()))
